import React from 'react'
import BH from "../../../../assets/img/home/bh.jpg";



function Card() {
	
	function repeat() {
		for (let i = 0; i < 10; i++) {
			console.log(i);
		}
	}
	
	return (
	 <>
	 <div class="max-w-sm bg-white border border-gray-400 rounded-lg shadow ">
		 <img class="bg-cover rounded-t-lg" src={BH} alt=""></img>
		 <div class="p-5">
			 <a>
				 <h5
				  class="mb-2 text-2xl font-bold tracking-tight text-gray-900">Noteworthy
					 technology acquisitions 2021</h5>
			 </a>
			 <p class="mb-3 font-normal text-gray-700 ">Here are the biggest
				 enterprise technology acquisitions of 2021 so far, in reverse chronological
				 order.</p>
		 </div>
	 </div>

	{repeat()}
	 </>
	
	)
}
export default Card;
